const Header = (props) => {
  return (
    <div>
      <p>
         {props.coursename}
      </p>
    </div>
  )
}

const Content = (props) => {
  return (
    <div>
      <p>
        <Part partname= {props.part1} exname = {props.ex1} />
        <Part partname= {props.part2} exname = {props.ex2} />
        <Part partname= {props.part3} exname = {props.ex3} />
      </p>
    </div>
  )
}

const Total = (props) => {
  return (
    <div>
      <p>
         {props.ex1} + {props.ex2} + {props.ex3}
      </p>
    </div>
  )
}

const Part = (props) => {
  return (
    <div>
      <p>
      {props.partname}, {props.exname}
      </p>
    </div>
  )
}

const App = () => {
  const course = 'Half Stack application development'
  const part1 = 'Fundamentals of React'
  const exercises1 = 10
  const part2 = 'Using props to pass data'
  const exercises2 = 7
  const part3 = 'State of a component'
  const exercises3 = 14

  return (
    <div>
      <h1> <Header coursename ={course} /> </h1>
      <p>
        <Content part1= {part1} part2= {part2} part3= {part3} ex1= {exercises1} ex2= {exercises2} ex3= {exercises3} />
      </p>
      <p><Total ex1 = {exercises1} ex2= {exercises2} ex3= {exercises3} /> </p>
    </div>
  )
}

export default App
